            <div className={classes.Title}>{props.ExpenseTitle}</div>
            <div className={classes.Text}>{props.ExpenseText}</div>
            <div className={classes.Amount}>Amount: {props.ExpenseAmount} {props.ExpenceCurrency}</div>
